//Landing Intro ------------------------------------

.About_Intro {
  width: 100%;
  position: relative;
  display: flex;
}

.About_Intro-Header {
  width: 50%;
  font-size: 70px;
  font-weight: 600;
  letter-spacing: -3px;
  padding-top: 120px;
  padding-right: 50px;
  transition: font-size 0.5s ease-in;
  opacity: 0;
  transition: opacity;
}

.Color-Blue {
  color: #df7904;
  font-family: vox, sans-serif;
  font-weight: 700;
  font-style: normal;
}
.Color-Orange {
  color: #df7904;
  font-family: vox, sans-serif;
  font-weight: 700;
  font-style: normal;
}
.Footer_Color-White {
  color: #fff;
}

.AboutIntro_Right {
  width: 50%;
  padding-top: 230px;
  padding-left: 40px;
}

.AboutIntro_Text {
  font-size: 28px;
  font-weight: 400;
  line-height: 46px;
  color: #f3f3f3;
  margin-bottom: 30px;
  opacity: 0;
  transition: opacity;
}

.AboutIntro_CTA {
  height: 40px;
  display: flex;
  align-items: center;
  opacity: 0;
  transition: opacity;
}

.AboutIntro_CTA-Arrow {
  height: 100%;
  margin-right: 20px;
  display: flex;
  align-items: center;
}

.AboutIntro_CTA-Text {
  font-size: 18px;
  font-weight: 600;
  color: #df7904;
}

//Height
@media screen and (max-height: 700px) {
  .About_Intro-Header {
    padding-top: 80px;
  }
  .AboutIntro_Right {
    padding-top: 150px;
  }
  .AboutIntro_Text {
    line-height: 32px;
  }
}
@media screen and (max-height: 700px) {
  .About_Intro-Header {
    padding-top: 60px;
  }
  .AboutIntro_Right {
    padding-top: 120px;
  }
}

@media screen and (max-width: 1700px) {
  .About_Intro-Header {
    padding-right: 0;
  }
}

@media screen and (max-width: 1600px) {
  .About_Intro-Header {
    font-size: 80px;
  }
  .AboutIntro_Text {
    font-size: 22px;
  }
}

@media screen and (max-width: 1400px) {
  .About_Intro-Header {
    font-size: 65px;
  }
  .AboutIntro_Text {
    font-size: 18px;
  }
}

@media screen and (max-width: 1200px) {
  .About_Intro {
    flex-direction: column;
  }
  .About_Intro-Header {
    width: 100%;
    max-width: 700px;
    margin-bottom: 40px;
  }
  .AboutIntro_Right {
    width: 100%;
    padding: 0;
  }
}

@media screen and (max-width: 700px) {
  .About_Intro-Header {
    padding-top: 80px;
    font-size: 55px;
  }
  .AboutIntro_Text {
    font-size: 18px;
  }
}

@media screen and (max-width: 500px) {
  .About_Intro-Header {
    padding-top: 60px;
    font-size: 40px;
  }
  .AboutIntro_Text {
    font-size: 18px;
    line-height: 40px;
  }
}

//Landing Gif ------------------------------------

.AboutGif {
  width: 100%;
  margin: 100px 0px;
  opacity: 0;
  transition: all;
}

.AboutGif-Wrap {
  width: 100%;
  height: 100%;
  position: relative;
  display: flex;
  justify-content: center;
}

.AboutGif-Image {
  width: 100%;
}

@media screen and (max-height: 700px) {
  .AboutGif-Image {
    width: 80%;
  }
}
